import React from "react";
import Table from "./Table";

const tableMetaData = [
  {
    headerTitle: "ID",
    render: (rowData) => <>{rowData["id"]}</>,
  },
  {
    headerTitle: "Name",
    render: (rowData) => <>{rowData["name"]}</>,
  },
  {
    headerTitle: "Age",
    render: (rowData) => <>{rowData["age"]}</>,
  },
  {
    headerTitle: "Gender",
    render: (rowData) => <>{rowData["gender"]}</>,
  },
  {
    headerTitle: "Date of Birth",
    render: (rowData) => <>{rowData["dateOfBirth"]}</>,
  },
  {
    headerTitle: "Area",
    render: (rowData) => <>{rowData["area"]}</>,
  },
  {
    headerTitle: "Email",
    render: (rowData) => <>{rowData["email"]}</>,
  },
  {
    headerTitle: "Phone Number",
    render: (rowData) => <>{rowData["phoneNumber"]}</>,
  },
  {
    headerTitle: "Occupation",
    render: (rowData) => <>{rowData["occupation"]}</>,
  },
  {
    headerTitle: "Actions",
    render: (rowData) => (
      <>
        <div className="row">
          <div className="col-md-6">
            <button>Edit</button>
          </div>
          <div className="col-md-6">
            <button>Delete</button>
          </div>
        </div>
      </>
    ),
  },
];

const PersonTable = ({ personData }) => {
  return (
    <div className="row mt-5">
      <div className="col-md-12">
        <h2>Table</h2>
        <Table tableMetaData={tableMetaData} personData={personData} />
      </div>
    </div>
  );
};

export default PersonTable;
